    private void sortie_btnActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_sortie_btnActionPerformed

        
        if(this.temp.getSelectedRow() == -1 || this.motif_s.getText().trim().isEmpty() || "MOTIF SORTIE".equalsIgnoreCase(this.motif_s.getText().trim())){
             
               JOptionPane.showMessageDialog(null, "PARAMETTRE INCORRECT") ;
               
         }else{
        
         SimpleDateFormat heure = new SimpleDateFormat("HH:mm") ;
         SimpleDateFormat sdf = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss") ;
         SimpleDateFormat sdf_ = new SimpleDateFormat("yyyy-MM-dd") ;
        
         Date jour = new Date() ;
        
         String emp_arrive ;
                emp_arrive = heure.format(jour) ;
               
               
         LocalTime start = LocalTime.parse(emp_arrive) ;
         LocalTime stop = LocalTime.parse(this.arrive) ;
         Duration duration = Duration.between(start, stop) ;
         
       //  JOptionPane.showMessageDialog(null, duration.toString().replace("PT", ""));
         
         long munite = duration.getSeconds() ;
         
      //   JOptionPane.showMessageDialog(null, "Seconde emp : "+munite);
         
         
         
         
            Connection conn = null ;
            Statement stmt = null ;
       
       try{
      //STEP 2: Register JDBC driver :
      Class.forName(JDBC_DRIVER) ;

      //STEP 3: Open a connection
     // System.out.println("Connecting to database...");
      
      conn = DriverManager.getConnection(DB_URL,USER,PASS);

      //STEP 4: Execute a query
      //System.out.println("Creating statement...");
      stmt = conn.createStatement();
      
      //je crai ma requete
       
      
      
      String sql = null ;
      ResultSet rs = null ;

      
         
                          
if(stmt.executeUpdate("insert into presence(id_emp,depart,retour,duree,duree_heure,motif,etat,login,datej) values('"+this.id+"', '"
       +emp_arrive+"' , '00:00:00' , 0 , 'vide' , '"+this.motif_s.getText().trim().replaceAll("'", "''")+"' , 'INITIAL' , '"+this.login+"' , '"+sdf.format(new Date())+"')") == 1){
       
     DefaultTableModel dtm = (DefaultTableModel) this.tsortie.getModel() ;
                       dtm.setRowCount(0) ;
                       
                        //  "ID", "ID EMP", "NOM & PRENOM", "MOTIF", "ETAT"
      sql = "select presence.id as ref , presence.id_emp as ide , employe.nom as nom , employe.prenom as prenom , "
              + "presence.motif as motif , presence.etat as etat "
              + "from employe , presence "
              + "where presence.datej like '%"+sdf_.format(new Date())+"%' and presence.pg = 'NON' and employe.id_emp = presence.id_emp" ;
      
      rs = stmt.executeQuery(sql) ;
      while(rs.next()){
          
          dtm.addRow(new Object[]{
    rs.getString("ref") , rs.getString("ide") , rs.getString("prenom")+" "+rs.getString("nom") , rs.getString("motif") , rs.getString("etat")
          }) ;
          
      }
                       
        this.temp.getSelectionModel().clearSelection();
        this.motif_s.setText("MOTIF SORTIE") ;
        
   }
      
       
      
      
     
      
    
            
       // STEP 6: Clean-up environment
      
     // System.out.println("Goodbye!");
      
   
      
      //STEP 6: Clean-up environment
//      rs.close();
      stmt.close();
      conn.close();
      
      
   }catch(SQLException se){
      //Handle errors for JDBC
      se.printStackTrace();
   }catch(Exception e){
      //Handle errors for Class.forName
      e.printStackTrace();
   }finally{
      //finally block used to close resources
      try{
         if(stmt!=null)
            stmt.close();
      }catch(SQLException se2){
      }// nothing we can do
      try{
         if(conn!=null)
            conn.close();
      }catch(SQLException se){
         se.printStackTrace();
      }//end finally try
   }//end try
        
          
       
         
               
         }
         
         
     
    }//GEN-LAST:event_sortie_btnActionPerformed

